import React from 'react'
import './footer.css'

import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap'
import { Link } from 'react-router-dom'

import logo from '../../assets/images/logo.png'

const quick__links = [
  {
    path:'/home',
    display: 'Home',
  },
  {
    path:'/about',
    display: 'About',
  },
  {
    path:'/blogs',
    display: 'Blogs',
  },
]

const quick__links2 = [
  {
    path:'/gallery',
    display: 'Gallery',
  },
  {
    path:'/login',
    display: 'Login',
  },
  {
    path:'/blogs',
    display: 'Blogs',
  },
]

const Footer = () => {
  return (
    <Container>
      <Row>
        <Col lg='3'>

        </Col>
      </Row>
    </Container>
  )
}

export default Footer
